function arclab_H2T($a)
{
$a=preg_replace('/<\s*/','<',$a);
$a=preg_replace('~<head[^>]*>(.*?)</\s*head\s*>~is','',$a);
$a=preg_replace('~<style[^>]*>(.*?)</\s*style\s*>~is','',$a);
$a=preg_replace('~<script[^>]*>(.*?)</\s*script\s*>~is','',$a);
$a=str_replace(array("\n","\r","\t"),'',$a);
$a=str_replace('&nbsp;',' ',$a);
$a=preg_replace('/<table/i',"\r\n<table",$a);
$a=preg_replace('/<div/i',"\r\n<div",$a);
$a=preg_replace('~</\s*(tr|th|div|p|li|h1|h2|h3|h4|h5|h6)\s*>~i',"\r\n",$a);
$a=preg_replace('~</\s*td\s*>\s*<td~i',' <td',$a);
$a=preg_replace('/<br/i',"\r\n<br",$a);
$a=trim(preg_replace('/<.*?>/s','',$a));
$a=html_entity_decode($a);
$a=preg_replace("/\r\n\r\n\s+/","\r\n\r\n",$a);
return $a."\r\n";
}

